    (i, j, k) = (low + 1, low + 1, high - 1)
    while j <= k:
        if arr[j] < pivot1:
            (arr[i], arr[j]) = (arr[j], arr[i])
            i += 1
        elif arr[j] > pivot2:
            while arr[k] > pivot2 and j < k:
                k -= 1
            (arr[j], arr[k]) = (arr[k], arr[j])
            k -= 1
            if arr[j] < pivot1:
                (arr[i], arr[j]) = (arr[j], arr[i])
                i += 1
        j += 1
    i += 1
    k += 1
    (arr[low], arr[i]) = (arr[i], arr[low])
    (arr[high], arr[k]) = (arr[k], arr[high])
    return (i, k)

